                                    Описание от продавца                            
Продается добротный  1-этажный  дом с площадью 240 кв.м:
 - в элитном и экологически чистом районе ж/м Ынтымак, от 8 Баха по счету четвёртая улица (ул..Калкагар)
-участок 8 соток размер 20x40
-ориентир (Царское село, Киргизия-1) Имеются все разрешительные документы. Собственник!
 В доме 4 спальных комнат, 1 большой зал, большая гостиная, коридор 2 санузла, 1 большая кухня,очок кана.
 Строили для себя с душой:
-Ремонт сделан качественно из качественных строй. материалов! Часть мебели встроена. 
-сейсмостойкость фундамента на высшем уровне -дом стоит на 14 железобетонных лапках с глубиной на 1.5 метра;
-толщина стен в 2 кирпича+утепление;
-5ти камерные качественные окна, отличная шумоизоляция, не пропускает холод;
- полное половое отопление 3ф+твердое топливо;
-центральная канализация; -высокоскоростной кабельный интернет Акнет,АлаTV;
-большой двор проложен брусчаткой;
-двор вмещает 6 автомобилей;
-участок огорожен, заборы высокие, железные ворота;
-имеется видеонаблюдение;
-домофон;
-большой навес
-хоз.постройки.
Проблем с водой нет ни летом, ни зимой, можно спокойно ухаживать за садом и огородом.

В районе имеются частные хорошие детские сады, школы и большой стадион.  Улица просторная, лишние машины не проезжают.
 Обжитый, тихий район со своей инфраструктурой. Соседи спокойные, дружные. Воздух чистый, горный, что полезно для здоровья. 

Рассматривается обмен на 3-х комнатную элитку с доплатой мне.
Стоимость $ США. Будет хороший торг, для реальных покупателей

